import React from "react";

function IndexBar() {
    return <div className="bottomNav">
        <div className="bottomObj hovering">
            <img src="images/tables_icon.png" />
            <p>Table</p>
            <img src="images/down-arrow.png" style={{ width: "12px", height: "12px" }} />
        </div>
    </div>
}

export default IndexBar;
